tables.table_schema:
CREATE TABLE venues (
  venue_id INT PRIMARY KEY,
  venue_name VARCHAR(255),
  capacity INT,
  location VARCHAR(255)
);

CREATE TABLE events (
  event_id INT PRIMARY KEY,
  event_name VARCHAR(255),
  date DATE,
  venue_id INT,
  FOREIGN KEY (venue_id) REFERENCES venues(venue_id)
);

